export default function Button({ slected, icon, text }) {
  const classBox = `${styles.buttonBox}`;
  return (
    <div className={classBox}>
      <div className={`${styles.iconBox} ${slected ? styles.selected : ""}`}>
        {icon}
      </div>
      <p className={`${styles.text} ${slected ? styles.selected : ""}`}>
        {text}
      </p>
    </div>
  );
}
